import { Router } from "express";
const router = Router();

import { 
    createSubject, 
    getSubjects, 
    getSingleSubject, 
    getMultipleSubjects,
    deleteSubject, 
    updateSubject, 
    setRequisites 
} from "../controllers/subjects.controller";

