import studentSchema from "../models/studentSchema";
import subjectSchema from "../models/subjectSchema";

import { dataProcessor } from "./dataProcessor";
import { studentsProcessor } from "./students.dataProcessor";

const errorMessage = "Student not found";

export async function getStudents(req, res) {
    let response = await studentsProcessor.getAllStudents();
    res.status(response.state);
    res.json(response);
    return;
}
export async function getSingleStudent(req, res) {
    let response = studentsProcessor.getStudent(req);

    if (response.message != "") {
        let error = response.message;
        response.message = dataProcessor.simplifyMessage(error);

        res.status(500);
    }

    res.json(response);
    return;
}
export async function getStudentWithSubjects(req, res) {
    const { document } = req.params;
    const { current, complete } = req.body;

    let response = {};

    try {
        const student = await studentSchema.findOne({
            where: {
                document
            }
        });
        if (student) {
            response.message = "Success";
            response.student = student;

            if(current) {
                response.current_count = 0;
                response.current_subjects = [];
                const subjects = student.current_subjects;

                for(const [id, grades] of Object.entries(subjects)) {
                    response.current_count += 1;
                    response.current_subjects.push( 
                        await subjectSchema.findOne({
                            where: {
                                id
                            }
                        }
                    ));
                }
            }

            if(complete) {
                response.complete_count = 0;
                response.complete_subjects = [];
                const subjects = student.complete_subjects;

                for(const [id, grades] of Object.entries(subjects)) {
                    response.complete_count += 1;
                    response.complete_subjects.push( 
                        await subjectSchema.findOne({
                            where: {
                                id
                            }
                        }
                    ));
                }
            }

            return res.json(response);

        } else {
            throw new Error("Student not found");
        }
