export async function createStudent(req, res) {
    console.log(req.body);
    const { document, name, lastname, email, phone } = req.body;

    try {
        const newStudent = await studentSchema.create({
            document,
            name,
            lastname,
            email,
            phone
        }, {
            fields: ["document", "name", "lastname", "email", "phone"]
        });
    
        if (newStudent) {
            return res.json({
                message: "Success",
                data: newStudent
            });
        }
    } catch (error) {
        console.log(error);
        res.status(500).json({
            message: "Fail",
            data: {}
        });   
    }
}

