        });   
    }
}

export async function updateStudent(req, res) {
    const { document } = req.params;
    const { name, lastname, email, phone, semester, current_subjects, complete_subjects, active} = req.body;
    try {
        const students = await studentSchema.findAll({
            attributes: ["id", "name", "lastname", "email", "phone", "semester", "current_subjects", "complete_subjects", "active", "updated_at"],
            where: {
                document
            }
        });
    
        if (students.length > 0) {
            const student = students[0];

            await studentSchema.update({
                name,
                lastname,
                email,
                phone,
                semester,
                current_subjects,
                complete_subjects,
                active,
                updated_at: new Date()
            }, {
                where: {
                    id: student.id
                }
            });

            return res.json({
                message: "Success",
                count: 1
            });
        } else {
            throw new Error("Student not found");
        }
        
    } catch (error) {
        console.log(error);
        res.status(500).json({
            message: "Fail",
            data: {}
        });   
    }
}
